import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Rocket, Shield, Users, Lightbulb, Handshake, Building2, Globe, Briefcase } from 'lucide-react';

const CompanyProfilePage = () => {
  const navigate = useNavigate();

  return (
    <div className="min-h-screen flex flex-col justify-center items-center">
      <h1 className="text-4xl font-bold text-[#1F3B66] mb-4">Hello</h1>
      <button
        onClick={() => navigate('/')}
        className="px-6 py-2 bg-[#D4A74B] text-white rounded-lg hover:bg-[#A88F68] transition"
      >
        Back to Home
      </button>
    </div>
  );
};

export default CompanyProfilePage;
